import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Navbar from './Nav';
import Projects from './Projects';
import About from './About';
import Home from './Home';

const Bubble = () => {

}

export default function App() {
    return (
        <Router>

        <body className={"min-h-screen bg-black"}>
        <div className={"blur-[100px]"}>
            <div className={"absolute inline-block bg-cyan-900/100 h-[30em] w-[30em] rounded-full right-[0em] top-[5em] "}></div>
            <div className={"absolute inline-block bg-blue-900/50 h-[30em] w-[30em] rounded-full left-[0em] top-[2em] "}></div>
        </div>
        <Navbar />
        <div className={"flex justify-center"}>
        <div className={"max-w-[100em]"}>
            <Routes>
                <Route exact path ='/' exact element={<Home />} />
                <Route path={"/projects"} element={<Projects/>}/>
                <Route path={"/about"} element={<About/>}/>
            </Routes>
        </div>
        </div>

        </body>
        </Router>
    );
}
